#创建数据库
CREATE DATABASE trafficPlanning DEFAULT CHARACTER SET utf8;


#创建城市列表
#城市id,中文名,英文名,经度,纬度
CREATE TABLE city(
city_id INT UNSIGNED NOT NULL,
name_cn varchar(20) NOT NULL,
name_en varchar(20) NOT NULL,
longitude DOUBLE NOT NULL,
latitude DOUBLE NOT NULL,
PRIMARY KEY(city_id)
)default charset=utf8;

#交通线路
#火车线路表
CREATE TABLE line_train(
line_id  varchar(15) NOT NULL PRIMARY KEY,
line_from INT UNSIGNED NOT NULL,
line_to INT UNSIGNED NOT NULL,
startTime TIME NOT NULL,
endTime TIME NOT NULL,
distance DOUBLE NOT NULL,
costTime TIME NOT NULL,
price DECIMAL(8,2) NOT NULL,
FOREIGN KEY(line_from) REFERENCES city(city_id),
FOREIGN KEY(line_to) REFERENCES city(city_id)
)default charset=utf8;

#交通线路
#飞机线路表
CREATE TABLE line_plane(
line_id  varchar(15) NOT NULL PRIMARY KEY,
line_from INT UNSIGNED NOT NULL,
line_to INT UNSIGNED NOT NULL,
startTime TIME NOT NULL,
endTime TIME NOT NULL,
distance DOUBLE NOT NULL,
costTime TIME NOT NULL,
price DECIMAL(8,2) NOT NULL,
FOREIGN KEY(line_from) REFERENCES city(city_id),
FOREIGN KEY(line_to) REFERENCES city(city_id)
)default charset=utf8;


